  \"2016-04-06T23:21:27.495498\",\n\t\"name\": \"cdc-wonder-mortality-multiple-cause-of-death\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Mortality - Multiple Cause of Death
  data on CDC WONDER are county-level national mortality and population data spanning
  the years 1999-2009. Data are based on death certificates for U.S. residents. Each
  death certificate contains a single underlying cause of death, up to twenty additional
  multiple causes (Boolean set analysis), and demographic data. The number of deaths,
  crude death rates, age-adjusted death rates, standard errors and 95% confidence
  intervals for death rates can be obtained by place of residence (total U.S., region,
  state, and county), age group (including infants and single-year-of-age cohorts),
  race (4 groups), Hispanic ethnicity, gender, year of death, and cause-of-death (4-digit
  ICD-10 code or group of codes, injury intent and mechanism categories, or drug and
  alcohol related causes), year, month and week day of death, place of death and whether
  an autopsy was performed. The data are produced by the National Center for Health
  Statistics.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
